import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import NavBar from './components/NavBar';
import HomeLink from './components/HomeLink.js'; // Import HomeLink
import UploadActivities from './components/UploadActivities';
import Stats from './components/Stats';
import ActivityHistory from './components/ActivityHistory';

function App() {
  return (
    <Router>
      <NavBar />

      {/* Main Dashboard Banner Image */}
      <div style={{
        backgroundImage: 'url(https://example.com/your-image.jpg)', 
        backgroundSize: 'cover', 
        height: '400px', 
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center',
        flexDirection: 'column',
        textAlign: 'center'
      }}>
        {/* HomeLink Component with link back to main page */}
        <HomeLink />

        <nav>
          <Link to="/">Home</Link>
          <Link to="/upload">Upload</Link>
          <Link to="/stats">Stats</Link>
          <Link to="/history">History</Link>
        </nav>
      </div>

      {/* Define Routes */}
      <Routes>
        <Route path="/upload" element={<UploadActivities />} />
        <Route path="/stats" element={<Stats />} />
        <Route path="/history" element={<ActivityHistory />} />
      </Routes>
    </Router>
  );
}

export default App;
